webpackJsonp([0xcf37575a117a],{599:function(e,t){e.exports={data:{assignments:{id:"YXNzaWdubWVudDoxNzg3",postId:1787,title:"Review automerge JSON library and understand application to RosterNet, Stature, Medigy, etc.",description:'<p>The automerge library is A JSON-like data structure that can be modified concurrently by different users, and merged again automatically. There is probably utility for it in RosterNet, Stature, Medigy, etc. In these ways:</p>\n<ul>\n<li>RosterNet could use multiple harvesters and merge data (or check for conflicts) before putting data into the database</li>\n<li>Stature could take a look at data from multiple data sources and review comparisons</li>\n<li>Medigy could take a look at data from multiple EHRs and combine into a single record</li>\n</ul>\n<p>Also check these:</p>\n<ul>\n<li><a href="http://www.jsondiff.com/">http://www.jsondiff.com/</a></li>\n<li><a href="https://github.com/zgrossbart/jdd">https://github.com/zgrossbart/jdd</a></li>\n</ul>\n',author:{name:"Shahid Shah",email:"shahid.shah@netspective.com"},expiryDate:null,actualUrl:"https://github.com/automerge/automerge",terms:[{categoryId:"416",name:"Architecture and Engineering"},{categoryId:"129",name:"Netspective Communications"},{categoryId:"421",name:"Netspective Medigy"},{categoryId:"425",name:"Netspective Stature"},{categoryId:"429",name:"RosterSource"}]}},pathContext:{id:"YXNzaWdubWVudDoxNzg3"}}}});
